import Create from './pages/Create'
import './App.css'

function App() {
  return (
    <div>
      {/* 프로젝트 제목 */}
      <header className='App-header'>React-CRUD-Project</header>
      {/* 왼쪽 목록 */}
      <div>
        목록
      </div>
      {/* 오른쪽 Create 컴포넌트 */}
      <Create/>
    </div>
  )
}

export default App
